const TabbedTable: React.FC<{ event: string, eventId: string, children: React.ReactNode }> = ({ event, eventId, children }) => {
    const [activeTab, setActiveTab] = useState(`${eventId}-age-17-21`);
    const childArray = React.Children.toArray(children);
    
    return (
        <>
            <h2 className="font-oswald text-3xl font-bold text-yellow-500 uppercase tracking-wider mb-6 text-center border-b-2 border-yellow-700/50 pb-3">{event}</h2>
            <div className="tabs-container mb-10">
                <div className="tab-buttons">
                    {ageGroups.map(ag => (
                        <button 
                            key={ag.key}
                            className={`tab-button ${activeTab === `${eventId}-age-${ag.key}` ? 'active' : ''}`}
                            onClick={() => setActiveTab(`${eventId}-age-${ag.key}`)}
                        >
                            {ag.label}
                        </button>
                    ))}
                </div>
                {React.Children.map(childArray, (child) => {
                    if (React.isValidElement(child)) {
                        return React.cloneElement(child as React.ReactElement<any>, {
                            className: `tab-pane ${activeTab === (child as React.ReactElement<any>).props.id ? 'active' : ''}`,
                        });
                    }
                    return child;
                })}
            </div>
        </>
    );
}

const EventTable: React.FC<{headers: string[], rows: (string|number)[][]}> = ({headers, rows}) => (
    <table className="aft-table">
        <thead>
            <tr>
                {headers.map(h => <th key={h}>{h}</th>)}
            </tr>
        </thead>
        <tbody>
            {rows.map((row, rowIndex) => (
                <tr key={rowIndex} className={row[0] === 60 ? 'highlight-row' : ''}>
                    {row.map((cell, cellIndex) => <td key={cellIndex}>{cell}</td>)}
                </tr>
            ))}
        </tbody>
    </table>
);

